import Table from './Components/Table'
import List from './Components/List'

class App extends Component {
  render() {
    const characters = [
        {
          name: 'Charlie',
          job: 'Janitor',
        },
        {
          name: 'Mac',
          job: 'Bouncer',
        },
        {
          name: 'Dee',
          job: 'Aspring actress',
        },
        {
          name: 'Dennis',
          job: 'Bartender',
        },
      ]
    return (
      <div className="container">
        <Table />
        <List />
      </div>
    )
  }
}

export default App
